const socketURL = 'https://hiddendoodle.herokuapp.com'

const playgame = (state, socket, i) => {
  const {level} = state
  if (i === 24) {console.log(level, level >= 1 && level <4)}
  if(level >= 1 && level <4) {
    const action = {
      type: 'ADD_DRAWING',
      body: state.num,
      part: state.part,
      drawing: drawing1
    }
    socket.emit('action', action)
  }

  if (level === 4 && i === 24) {
    console.log(state.body.final.substring(0, 100))
  }
}

const setup = (i) => {
  const options = {
      transports: ['websocket'],
      forceNew: true
    }

  const socket = io('https://hiddendoodle.herokuapp.com', options)

    socket.on('connect', () => {
      const action = {
        type: 'SET_DIMENSIONS',
        dimensions: {height: 500, width: 1000 },
        playerId: socket.id
      }
      socket.emit('action', action)
    })

    socket.on('state', state => {
      playgame(state, socket, i)
    })
}

setup()

for ( let i = 1; i <25; i++ ) {
  setup(i)
}

